import React from 'react';
import styled from 'styled-components';

const NavContainer = styled.div`
display: flex;
height: 50px;
width: 100%;
background-color: ${props => props.theme.colors.primary};

.imgContainer{
    width: 100px;
    border:1px solid lime;
}

img{
    display: block;
    max-width: 100%;
    height: auto;
    object-fit: contain;
    border: 1px solid lime;
}

`

export const Navbar = props => {
    return(
        <NavContainer>
            <img height="200" width="200" src={'/personal_logo_free.png'}/>

        </NavContainer>
    )
}
